import Header from "../components/Header"
import "./styles/Home.css";

export default class Home extends Component {
  render() {
    return (

        <React.Fragment>
            <Header /> 

            <div className="container-fluid">
                <div className="col-6"></div>

            </div> 

        </React.Fragment>
    );
  }
}
